const CoinPrice = () => {

    const [coin,getCoin] = useState({})


    fetch("https://api.upbit.com/v1/ticker?markets=krw-btc")
    .then(res => res.json())
    .then (res => {
        getCoin(res);
    })




    return(
        <div>
            {coin}
        </div>
    )

}

export default CoinPrice;
